import React from "react";

const ItsOverNineThousand = ({ result, setResult }) => {
	if (setResult(eval(result).toString() > 9000)) {
		return (
			<div>
				<h1>It is over Nine</h1>
			</div>
		);
	}
};

export default ItsOverNineThousand;
